import "../styles/styles.css";

const NavBar=() =>{
    return(
        <nav>
            <img src="img/logo.png" alt="logo" />
            <a href="#home">Home</a>
            <a href="#shop">Shop</a>
            <a href="#contact">Contacto</a>
        </nav>
    )
}

export default NavBar;
